import React, { Component } from 'react';
import { Card, Row, Col } from 'react-bootstrap'


class Products extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <>
                <Row noGutters>
                    <Col>
                        <Card>
                            <Card.Header>
                                <div>New Arrival</div>
                            </Card.Header>
                            <Card.Body>
                                <Row>
                                    <Col>
                                        {1}
                                    </Col>
                                    <Col>
                                        {1}
                                    </Col>
                                    <Col>
                                        {1}
                                    </Col>
                                    <Col>
                                        {1}
                                    </Col>
                                </Row>
                            </Card.Body>
                        </Card>
                    </Col>
                    <Col>
                        <Card>
                            <Card.Header>
                                <div>New Arrival</div>
                            </Card.Header>
                            <Card.Body>
                                <Row>
                                    <Col>
                                        {1}
                                    </Col>
                                    <Col>
                                        {1}
                                    </Col>
                                    <Col>
                                        {1}
                                    </Col>
                                    <Col>
                                        {1}
                                    </Col>
                                </Row>
                            </Card.Body>
                        </Card>
                    </Col>
                </Row>
            </>
        );
    }
}

export default Products;
